{
  "lockfile-version": 1,
  "manifest": {
    "version": 1,
    "install": {
      "curl": {
        "pkg-path": "curl"
      },
      "docker": {
        "pkg-path": "docker"
      },
      "jq": {
        "pkg-path": "jq"
      },
      "just": {
        "pkg-path": "just"
      },
      "mongodb-ce": {
        "pkg-path": "mongodb-ce",
        "version": "8.0.4"
      },
      "mongosh": {
        "pkg-path": "mongosh"
      },
      "nodejs": {
        "pkg-path": "nodejs"
      },
      "pnpm": {
        "pkg-path": "pnpm_8"
      },
      "uv": {
        "pkg-path": "uv"
      }
    },
    "vars": {
      "FASTIFY_HOST": "127.0.0.1",
      "FASTIFY_PORT": "8888",
      "FRONTEND_HOST": "127.0.0.1",
      "FRONTEND_PORT": "5175",
      "JWT_EXPIRY": "7d",
      "JWT_SECRET": "your_jwt_secret_here",
      "MONGO_DATA_DIRECTORY": "./data/db",
      "MONGO_DB_NAME": "codincod-dev",
      "MONGO_HOST": "127.0.0.1",
      "MONGO_PORT": "27017",
      "MONGO_URI": "mongodb://127.0.0.1:27017/codincod",
      "NODE_ENV": "development",
      "ORIGIN": "http://127.0.0.1:5173",
      "PISTON_URI": "http://localhost:2000",
      "VITE_BACKEND_URL": "http://127.0.0.1:8888",
      "VITE_BACKEND_WEBSOCKET_MULTIPLAYER": "ws://127.0.0.1:8888"
    },
    "hook": {
      "on-activate": "  mkdir -p $MONGO_DATA_DIRECTORY\n  echo \"MongoDB data: $MONGO_DATA_DIRECTORY/\"\n  echo \"Backend:  http://$FASTIFY_HOST:$FASTIFY_PORT\"\n  echo \"Frontend: http://$FRONTEND_HOST:$FRONTEND_PORT\"\n"
    },
    "profile": {
      "fish": "  abbr -a -- fs 'flox services'\n  abbr -a -- fsl 'flox services logs'\n  abbr -a -- fss 'flox services status'\n"
    },
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    },
    "services": {
      "devbackend": {
        "command": "pnpm run --dir ./libs/backend dev"
      },
      "devfrontend": {
        "command": "pnpm run --dir ./libs/frontend dev --host $FRONTEND_HOST --port $FRONTEND_PORT"
      },
      "devtypes": {
        "command": "pnpm run --dir ./libs/types dev"
      },
      "mongodb": {
        "command": "mongod --dbpath $MONGO_DATA_DIRECTORY --bind_ip $MONGO_HOST --port $MONGO_PORT"
      },
      "piston": {
        "command": "docker-compose up piston"
      }
    }
  },
